void initializePlayer(CD*,int,int);
void createPlayer(CD*,int,int);
int getPlayerMoveNumber(CD*,int);
void motionPlayer(CD*,SD*,CD*,ID*);

void initializePlayer(CD* cd,int state,int direction){
	createPlayer(cd,getPlayerMoveNumber(cd,state),direction);
	cd->a0=-4.5;
	cd->aA=-4.5;
	cd->aX=4.0;
	cd->maxHitPoint=cd->hitPoint=200;
	cd->maxStamina=cd->stamina=100;
	cd->v0=0;
	cd->vA=0;
	cd->vX=0;
	cd->wallKickFlag=FALSE;
	cd->fallTime=0;
	cd->fallFlag=FALSE;
	cd->jumpCount=0;
	cd->chargeGauge=0;
	cd->maxChargeGauge=100;
	cd->deathFlag=FALSE;
	cd->existFlag=TRUE;
}
void createPlayer(CD* cd,int number,int direction){
	int y,x;
	for(y=0;y<CHARACTER_LINES;y++){
		for(x=0;x<CHARACTER_COLS;x++){
			if(direction>0)
				cd->look[y][x]=playerInfo[number][y][x];
			else if(direction<0)
				cd->look[y][x]=playerInfo[number][y][CHARACTER_COLS-x-1];
		}
	}
	cd->number=number;
	cd->direction=direction;
}
int getPlayerMoveNumber(CD* cd,int state){
	switch(state){
		case NO_ACTION:
			return 0;
		case WALK:
			return 1;
		case JUMP_UP:
			return 4;
		case JUMP_DOWN:
			return 5;
		case N_ATTACK1:
			return 6;
		case N_ATTACK2:
			return 9;
		case S_ATTACK:
			return 12;
		default:
			return 0;
	}
}
void motionPlayer(CD* cd,SD* sd,CD* ed,ID* id){
	switch(cd->motionFlag){
		case NO_ACTION:
			if(cd->fallFlag==FALSE){
				if((cd->stamina+=2)>cd->maxStamina)
					cd->stamina=cd->maxStamina;
				cd->vX=0;
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag),cd->direction);
			}
			else{
				if(cd->fallTime<getParabolaTopTime(cd->v0))
					createPlayer(cd,getPlayerMoveNumber(cd,JUMP_UP),cd->direction);
				else
					createPlayer(cd,getPlayerMoveNumber(cd,JUMP_DOWN),cd->direction);
				cd->motionFlag=NO_ACTION;
			}
			cd->motionCount=0;
			break;
		case WALK:
			if(cd->fallFlag==FALSE){
				if(cd->motionCount%8>=0&&cd->motionCount%8<2)
					createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+1,cd->direction);
				else if(cd->motionCount%8>=2&&cd->motionCount%8<4)
					createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+2,cd->direction);
				else if(cd->motionCount%8>=4&&cd->motionCount%8<6)
					createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+1,cd->direction);
				else if(cd->motionCount%8>=6)
					createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag),cd->direction);
			}
			walk(cd);
			if(cd->fallFlag==FALSE)
				cd->motionCount++;
			cd->motionFlag=NO_ACTION;
			break;
		case JUMP:
			if(cd->jumpCount<2&&cd->stamina>=20){
				if(cd->wallKickFlag==TRUE){
					cd->vX*=-1;
					if(cd->vX>0)
						createPlayer(cd,cd->number,RIGHT);
					else if(cd->vX<0)
						createPlayer(cd,cd->number,LEFT);
				}
				jump(cd);
				cd->stamina-=20;
			}
			cd->motionFlag=NO_ACTION;
			break;
		case N_ATTACK1:
		case N_ATTACK2:
			if(cd->motionCount==0){
				if(cd->stamina-10<0){
					cd->motionFlag=NO_ACTION;
					break;
				}
				cd->stamina-=10;
			}
			if(cd->motionCount>=0&&cd->motionCount<3)
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag),cd->direction);
			else if(cd->motionCount>=3&&cd->motionCount<6)
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+1,cd->direction);
			else if(cd->motionCount>=6&&cd->motionCount<9)
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+2,cd->direction);
			else
				cd->motionFlag=NO_ACTION;
			cd->motionCount++;
			break;
		case S_ATTACK:
			if(cd->motionCount==0){
				if(cd->stamina-50<0){
					cd->motionFlag=NO_ACTION;
					break;
				}
				if(cd->chargeGauge-cd->maxChargeGauge<0){
					cd->motionFlag=NO_ACTION;
					break;
				}
				cd->stamina-=50;
				cd->chargeGauge-=cd->maxChargeGauge;
			}
			if(cd->motionCount>=0&&cd->motionCount<3)
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag),cd->direction);
			else if(cd->motionCount>=3&&cd->motionCount<6)
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+1,cd->direction);
			else if(cd->motionCount>=6&&cd->motionCount<18)
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+2,cd->direction);
			else if(cd->motionCount>=18&&cd->motionCount<20)
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+3,cd->direction);
			else if(cd->motionCount>=20&&cd->motionCount<22){
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+4,cd->direction);
				sd->displayY-=4;
				bkgd(COLOR_PAIR(8));
			}
			else if(cd->motionCount>=22&&cd->motionCount<24){
				createPlayer(cd,getPlayerMoveNumber(cd,cd->motionFlag)+5,cd->direction);
				sd->displayY+=6;
				bkgd(COLOR_PAIR(6));
			}
			else{
				cd->motionFlag=NO_ACTION;
				sd->displayY-=2;
			}
			cd->motionCount++;
			break;
		default:
			break;
	}
}

